      content = <p className='ml-[520px] mt-10 text-lg font-baskerville font-medium'>
          Honeywell 2020-2021 : Software Engineer


      </p>;
      <p>
         TruWeather Solutions 2022-Present: Software Engineer
      </p>
      </div>
